import { createStore } from "vuex";

export default createStore({
  state: {
    userData: {},
  },
  getters: {},
  mutations: {
    setUser(state, payload) {
      const string = JSON.stringify(payload);
      state.userData = JSON.parse(string);
      console.log(state.userData);
    },
  },
  actions: {},
  modules: {},
});
